    <rect x="2" y="3" width="4" height="3" fill="#1E90FF" />
    <rect x="2" y="6" width="1" height="1" fill="#1E90FF" />
    <rect x="5" y="6" width="1" height="1" fill="#1E90FF" />
    <rect x="3" y="2" width="1" height="1" fill="#000" />
    <rect x="5" y="2" width="1" height="1" fill="#000" />
    <rect x="3" y="4" width="2" height="1" fill="#FFA500" />
  </svg>
);

export default Hero;
